### Summary of Core Topics and Concepts

#### Database Management Systems

1. **Functional Dependencies and Normalization**
   - **Functional Dependencies (FDs):** Relationships between attributes in a relation.
     - Example: \( A \rightarrow B \) means attribute \( A \) determines attribute \( B \).
   - **Normalization:** Process of organizing data to minimize redundancy.
     - **1NF (First Normal Form):** All attributes contain atomic values.
     - **2NF (Second Normal Form):** Meets 1NF and all non-key attributes are fully functionally dependent on the primary key.
     - **3NF (Third Normal Form):** Meets 2NF and no transitive dependencies.
     - **BCNF (Boyce-Codd Normal Form):** Meets 3NF and for every functional dependency \( X \rightarrow Y \), \( X \) is a superkey.
     - **4NF (Fourth Normal Form):** Meets BCNF and has no multi-valued dependencies.

2. **Decomposition**
   - **Lossless Decomposition:** Decomposing a relation into smaller relations without losing information.
   - **Dependency-Preserving Decomposition:** Ensuring that all functional dependencies are preserved in the decomposed relations.

3. **Armstrong's Axioms**
   - **Reflexivity:** If \( Y \subseteq X \), then \( X \rightarrow Y \).
   - **Augmentation:** If \( X \rightarrow Y \), then \( XZ \rightarrow YZ \).
   - **Transitivity:** If \( X \rightarrow Y \) and \( Y \rightarrow Z \), then \( X \rightarrow Z \).

4. **SQL Injection**
   - **Definition:** A code injection technique that exploits vulnerabilities in the database layer.
   - **Examples:**
     ```sql
     SELECT userid, name, password FROM users WHERE userid = 160 or 1=1;
     ```

5. **Disk Storage**
   - **Capacity Calculation:** Total storage capacity of a disk.
     - Formula: \( \text{Capacity} = \text{Number of Platters} \times \text{Surfaces per Platter} \times \text{Tracks per Surface} \times \text{Sectors per Track} \times \text{Bytes per Sector} \).
   - **Rotational Latency:** Time taken for the disk to rotate to the desired sector.
     - Formula: \( \text{Rotational Latency} = \frac{1}{2 \times \text{RPM}} \times 60 \times 1000 \) milliseconds.

